import React from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "react-router-dom";

import { selectCartItems } from "../../redux/cart/cart.selectors";

import "./cart.styles.scss";

const Cart = () => (
  <div>
    <div className="cart">
      <div className="cart-header">
        <div className="header-item">
          <span>Product</span>
        </div>
        <div className="header-item">
          <span>Name</span>
        </div>
        <div className="header-item">
          <span>Quantity</span>
        </div>
        <div className="header-item">
          <span>Price</span>
        </div>
      </div>
    </div>
  </div>
);

export default Cart;
